import React from "react";
import { Form, Button } from 'react-bootstrap'

function AboutMe() {
  return (
    <Form className="px-4">
      <Form.Label >About Me</Form.Label>
      <Form.Control as="textarea" className="m" rows="3"/>
      <Button hidden type="submit">
        Save
      </Button>
    </Form>
  );
}

export default AboutMe;
